function Input(props) {
  const {
    labelName,
    labelClass,
    labelSpan,
    yearlySpan,
    spanClass,
    spanYearleClass,
    typeInput,
    inputId,
    inputValue,
    placeholderInput,
    checked,
    onChange
  } = props;

  return (
  <label className={labelClass}>
      {labelName}
      <span className={spanClass}>{labelSpan}</span>
      <span className={spanYearleClass}>{yearlySpan}</span>
      <input
        checked={checked}
        onChange={onChange}
        // onChange={onCheckedChange}
        type={typeInput}
        name={typeInput}
        id={inputId}
        value={inputValue}
        placeholder={placeholderInput}
      />
    </label>
  );
}

export default Input;
